import {BrowserRouter as Router,Route} from 'react-router-dom';

import Chat from './components/Chat';
export default function App()
{
    return (
        <Router>
            <Route path = '/client' />
            <Route path = '/' component={Chat} />
            <Chat></Chat>
        </Router>
    );
}
